import React, { Component } from 'react'
import styled from 'styled-components'

const Container= styled.div`
  background: silver;
  border: solid 1px black;
  display: flex;
  flex-direction: column;
  justify-content: center;
  margin-top: 10px;
  width: 80%;
`
const Header= styled.div`
  display: flex;
  justify-content: center;
  width: 100%;
  border-bottom: solid 1px black;
  font-weight: bold;
  font-size: 24px;
  font-family: Century Gothic;
`
const ProjectsContainer= styled.div`
  display: flex;
  justify-content: space-around;
`

const Link= styled.a`
  color: rgb(0, 196, 132);
`

class Projects extends Component {
  render() {
    return (
      <Container>
        <Header>Projects</Header>
        <ProjectsContainer>
        <LinkContainer>
          <Link href='https://seo-the-platinum.github.io/react-forum/'> React Forum </Link>
        </LinkContainer>
        <Link href='https://seo-the-platinum.github.io/restaurant-review/'> Restaurant Review </Link>
        <Link href='https://snack.expo.io/@oe5i73/udaciflashcards'> Udaciflashcards </Link>
        </ProjectsContainer>
      </Container>
    )
  }
}

export default Projects
